import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getAllKyc } from "../../../actions/adminActions";
import "./AdminKyc.css";

const AdminKyc = () => {
  const dispatch = useDispatch();
  const kyc = useSelector((state) => state.allKyc);

  const [ed, setEd] = useState('');

  console.log(kyc);

  useEffect(() => {
    dispatch(getAllKyc());
  }, []);

  return (
    <div className="kyc">
      Kyc
      <div className="kyc-box">
        {" "}
        <div className="top">
          <button className="bnt" onClick={() => setEd("kycReq")}>
            Employees
          </button>
          <button className="bnt" onClick={() => setEd("acceptedKyc")}>
            Employers
          </button>
          <button className="bnt" onClick={() => setEd("block")}>
            Blocked Users
          </button>
        </div>
      </div>
    </div>
  );
};

export default AdminKyc;
